  - name: TEXT4000
    number: '6'
    value: 'Upon further reconciliation of activity during the reporting period, we
      identified the following changes on the June Monthly report and submit this
      amended report to reflect these changes:  Our amended report reflects an insufficient
      funds contribution in the amount of $1,000 originally itemized on Lines 11a,
      an additional transfer of allocated nonfederal funds in the amount of $2,642.67
      Schedule H3, and an additional expense for rent & parking in the amount of $1,929.72
      on Schedule H4.  The net change in cash on hand is ($287.05).  Schedule B, Line
      21(b) reports reimbursements for travel expenses which are not itemized because
      they do not exceed the $200 itemization level and do not exceed the $200 aggregate
      per vendor amount.  With respect to the expenditures made by the Party for payroll,
      payroll taxes, and other payroll or employee benefit-related expenses, the Party
      adheres to 11 CFR 300.33, and also follows the Commissions revision of the rules
      as adopted on December 1, 2005. Specifically, the Party pays for these costs
      with 100% federal funds when the employee spends more than 25 percent of his
      or her time in a month on federal election activity (FEA) or activity in connection
      with a federal election. These expenditures are reported on Schedule B for Line
      30b.  Alternatively, when an employee does not meet the 25 percent threshold,
      the Party allocates these costs as an overhead/administrative expense, and reports
      these disbursements on a Schedule H4 for Line 21a.'
